        "publishedAt": "2021-04-23T08:16:08Z",
        "channelId": "UCcN3IuIAR6Fn74FWMQf6lFA",
        "title": "What is the Fibonacci Sequence & the Golden Ratio? Simple Explanation and Examples in Everyday Life",
        "description": "The Fibonacci sequence is a series of numbers in which a given number is the addition of the two numbers before it. So, if you start with 0, the next number will be 1, followed by 1, followed by 2, followed by 3 and so on. As you can see, every number in this series or sequence is obtained by adding the two preceding numbers. This simple series of numbers is referred to as the Fibonacci sequence for Fibonacci series. And individual numbers in this sequence are often called Fibonacci numbers.\n\nTo the uninitiated, it may just seem like a series of numbersbut the Fibonacci sequence has been discovered and rediscovered in various forms, not only in mathematicsbut also in nature and our everyday lives. \n\nThere’s another exciting offshoot of the Fibonacci sequence - the golden ratio. Seashells are one of the most common examples of the golden spiral in nature. Ocean waves, hurricanes, flower buds, snail shells, spider webs are some of the many naturally-occurring examples.\n\n#science #animation #fibonacci\n\nIntro - (0:00)\nWhat is the Fibonacci sequence - (0:57)\nLeonardo of Pisa and the Fibonacci sequence - (1:39)\nFibonacci sequence and the Golden Ratio - (2:56)\n\nSUBSCRIBE to get more such science videos! \nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\nFollow us on Twitter! \nhttps://twitter.com/abc_science\n\nFollow us on Facebook!\nhttps://facebook.com/sciabc\n\nFollow our Website!\nhttps://www.scienceabc.com",
